const Skills = () => {
  return (
    <div className='aboutupperdiv'>

<div className='pagepartion'>
          <Typography className='abouttext'>My Skills</Typography>
        </div>
    
        <div className='pagepartion'>
        <img alt='img' src='https://cdn-icons-png.flaticon.com/512/732/732212.png' />
          <img alt='img' src='https://cdn-icons-png.flaticon.com/512/732/732212.png' />
        </div>
       

    </div>
    
  )
}

export default Skills;
